static inline uint8_t byte(uint64_t x, int n) {
#if BYTE_ORDER == LITTLE_ENDIAN
  return (uint8_t) (x >> ((n << 3) & 63));
#elif BYTE_ORDER == BIG_ENDIAN
  return (uint8_t) (x >> ((~n << 3) & 63));
#endif
}

static inline void p(uint64_t *state) {
  uint64_t tmp[8];
  size_t i, j;
  for (i = 0; i < 10; i += 2) {
    for (j = 0; j < 8; j++) {
      tmp[j] = t[0][byte(state[(j + 0) & 7], 0) ^ i ^ (j << 4)] ^
               t[1][byte(state[(j + 1) & 7], 1)] ^
               t[2][byte(state[(j + 2) & 7], 2)] ^
               t[3][byte(state[(j + 3) & 7], 3)] ^
               t[4][byte(state[(j + 4) & 7], 4)] ^
               t[5][byte(state[(j + 5) & 7], 5)] ^
               t[6][byte(state[(j + 6) & 7], 6)] ^
               t[7][byte(state[(j + 7) & 7], 7)];
    }
    for (j = 0; j < 8; j++) {
      state[j] = t[0][byte(tmp[(j + 0) & 7], 0) ^ (i + 1) ^ (j << 4)] ^
                 t[1][byte(tmp[(j + 1) & 7], 1)] ^
                 t[2][byte(tmp[(j + 2) & 7], 2)] ^
                 t[3][byte(tmp[(j + 3) & 7], 3)] ^
                 t[4][byte(tmp[(j + 4) & 7], 4)] ^
                 t[5][byte(tmp[(j + 5) & 7], 5)] ^
                 t[6][byte(tmp[(j + 6) & 7], 6)] ^
                 t[7][byte(tmp[(j + 7) & 7], 7)];
    }
  }
}

static inline void q(uint64_t *state) {
  uint64_t tmp[8];
  size_t i, j;
  for (i = 0; i < 10; i += 2) {
    for (j = 0; j < 8; j++) {
      tmp[j] = t[0][~byte(state[(j + 1) & 7], 0) & 0xff] ^
               t[1][~byte(state[(j + 3) & 7], 1) & 0xff] ^
               t[2][~byte(state[(j + 5) & 7], 2) & 0xff] ^
               t[3][~byte(state[(j + 7) & 7], 3) & 0xff] ^
               t[4][~byte(state[(j + 0) & 7], 4) & 0xff] ^
               t[5][~byte(state[(j + 2) & 7], 5) & 0xff] ^
               t[6][~byte(state[(j + 4) & 7], 6) & 0xff] ^
               t[7][(~byte(state[(j + 6) & 7], 7) & 0xff) ^ i ^ (((j + 6) & 7) << 4)];
    }
    for (j = 0; j < 8; j++) {
      state[j] = t[0][~byte(tmp[(j + 1) & 7], 0) & 0xff] ^
                 t[1][~byte(tmp[(j + 3) & 7], 1) & 0xff] ^
                 t[2][~byte(tmp[(j + 5) & 7], 2) & 0xff] ^
                 t[3][~byte(tmp[(j + 7) & 7], 3) & 0xff] ^
                 t[4][~byte(tmp[(j + 0) & 7], 4) & 0xff] ^
                 t[5][~byte(tmp[(j + 2) & 7], 5) & 0xff] ^
                 t[6][~byte(tmp[(j + 4) & 7], 6) & 0xff] ^
                 t[7][(~byte(tmp[(j + 6) & 7], 7) & 0xff) ^ (i + 1) ^ (((j + 6) & 7) << 4)];
    }
  }
}

static void compress(uint64_t *state, const uint64_t *block) {
  uint64_t tmp[8];
  size_t i;
  for (i = 0; i < 8; i++) {
    tmp[i] = state[i] ^ block[i];
  }
  p(tmp);
  for (i = 0; i < 8; i++) {
    state[i] ^= tmp[i];
  }
  memcpy(&tmp, block, 64);
  q(tmp);
  for (i = 0; i < 8; i++) {
    state[i] ^= tmp[i];
  }
}

void hash_extra_groestl(const void *data, size_t length, char *hash) {
  uint64_t state[8];
  uint64_t buffer[8];
  size_t i;
  memset(&state, 0, 56);
  state[7] = SWAP64BE(256);
  for (i = 0; i + 64 <= length; i += 64) {
    compress(state, cpadd(data, i));
  }
  memcpy(&buffer, cpadd(data, i), length - i);
  *(uint8_t *) padd(buffer, length - i) = 0x80;
  if (length - i >= 56) {
    memset(padd(&buffer, length - i + 1), 0, 64 - (length - i + 1));
    compress(state, buffer);
    memset(&buffer, 0, 56);
  } else {
    memset(padd(&buffer, length - i + 1), 0, 56 - (length - i + 1));
  }
  buffer[7] = swap64be((length + 72) >> 6);
  compress(state, buffer);
  memcpy(&buffer, &state, 64);
  p(buffer);
  for (i = 0; i < 4; i++) {
    ((uint64_t *) hash)[i] = state[i + 4] ^ buffer[i + 4];
  }
}
